import styled from "styled-components"
import './Contacts.css'

const Bodyfooter = styled.div`
background-color: aqua;
`
export const Contact = ()=> {
    return(
        <footer>
            <Bodyfooter>
                
                <div>Numero</div>
                <div>Gmail</div>
              
            </Bodyfooter>
        </footer>
    )
}
